const users = [
  {id: 1, name:'Alice'},
  {id: 2, name: 'Raj'},
  {id: 3, name: 'Rahul'}
];


const List = () => {
  return (
    <>
    <ul>
    {users.map(user => (
      <li key={user.id}>{user.name}</li>
    ))}
    </ul>
    </>
  );
}

export default List;
